import React, {Component} from 'react';
import './Video.css'

class Video extends Component {
  render() {
    return(
      <div className="container">
        <div className="title">Video Learning</div>
        <div className="video-board">
          Video Learning goes here
        </div>
      </div>
    );
  }
}

export default Video;
